script: |
  super -f text -I q5608.spq | sort > q5608.out

inputs:
  - name: q5608.spq
    data: |
      SELECT DISTINCT - col0 AS col2 FROM tab1 (FORMAT parquet) WHERE - col0 * col0 + + col1 NOT IN ( col1 * + col2 );
  - name: tab1

outputs:
  - name: q5608.out
    data: |
      -3
      -64
      -80
